text:
Худ едет на гору,
Худ едет под гору;
Худ худу бает:
Ты худ, я худ;
Сядь худ на худ;
Погоняй худ худом,
Железным прутом.

Сосулька испугалась высоты,
Сосулька от испуга стала плакать;
И потому опять настала слякать.

- Козел, мукомол, кому муку молол? А кому не молол?
- От того, кому молол, получал пироги;
От того, кому не молол, получал тумаки.
